import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Targets = () => {
  const handleSelect1 = (eventKey) => {
    // Handle the selected item here if neededs
  };

  return (
    <Dropdown>
      <Dropdown.Toggle variant="danger" id="dropdown-basic">
        Please Select A Target
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item onSelect={() => handleSelect1(1)}>
        <a className="navbar-brand text-white text-bold" href="/">ANNEC Finder</a>
        </Dropdown.Item>
        <Dropdown.Item onSelect={() => handleSelect1(2)}>
          <Link to="/Maow" style={{ textDecoration: 'none', color: 'inherit' }}>
            Maow
          </Link>
        </Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
};

export default Targets;
